import React from "react";
import homeImage from "../images/home_image.png";
const Home = () => {
  return (
    <>
      <section id="banner">
        <div className="container">
          <div className="row">
            <div className="col-md-6">
              <p>Grow your business with</p>
              <p>WE SHOWED UP</p>
              
            </div>
          </div>
        </div>  
      </section>
    </>
  );
};

export default Home;
